import React from 'react';
import { 
  Paper, 
  List, 
  ListItem, 
  ListItemText, 
  ListItemButton,
  Typography,
  ListItemAvatar,
  Avatar,
  Box
} from '@mui/material';

function LaunchGrid({ launches, selectedLaunch, onSelectLaunch }) {
  return (
    <Paper sx={{ height: '100%', overflow: 'auto' }}>
      <List>
        {launches.map((launch) => (
          <ListItem key={launch.id} disablePadding>
            <ListItemButton 
              selected={selectedLaunch?.id === launch.id}
              onClick={() => onSelectLaunch(launch)}
            >
              <ListItemAvatar>
                <Avatar
                  variant="rounded"
                  src={launch.links?.patch?.small || launch.links?.flickr?.small?.[0]}
                  alt={launch.name}
                  sx={{ width: 56, height: 56, mr: 2 }}
                >
                  ðŸš€
                </Avatar>
              </ListItemAvatar>
              <Box sx={{ display: 'flex', flexDirection: 'column', flex: 1 }}>
                <ListItemText
                  primary={launch.name}
                  secondary={
                    <>
                      <Typography component="span" variant="body2">
                        {new Date(launch.date_utc).toLocaleDateString()}
                      </Typography>
                      {' â€” '}{launch.success ? 'Success' : 'Failed'}
                    </>
                  }
                />
              </Box>
            </ListItemButton>
          </ListItem>
        ))}
      </List>
    </Paper>
  );
}

export default LaunchGrid;
